(110739, 'IRQ-2010-1-448-145', 2010, '1', 1, '1-62', 259, 'Iraq:Government', '448', 524, 'Government of Iraq - IS', '645', 116, 'Government of Iraq', '1076', 234, 'IS', -1, 'BBC Monitoring Middle East, 2010-12-12, Top Iraqi police officer injured in Ba\'qubah suicide blast', '', '', '', 'Northeast Iraq\'s Diyala police director has escaped an assassination attempt by an explosive charge that blew up targeting his motorcade west of Ba\'qubah, the capital of the province, a security source said on Sunday [12 December].\n\n"An explosive charge blew up targeting the motorcade of Diyala Province\'s police director, Brigadier Raghib al-Umairu, in Ghat\'un District, 2 km to the west of Ba\'qubah. It occurred during his inspection of the site of an attack, carried out by a suicide bomber wearing an explosive belt, earlier in the day against a Shi\'i Husseini procession," the security source told Aswat al-Iraq news agency.\n\nHe said that Brigadier Umairi and an unspecified number of policemen had been injured and taken to a nearby hospital for treatment.\n\nA suicide bomber, wearing an explosive belt, blew himself up earlier in the day targeting a Shi\'i Husseini procession in Ghat\'un District, 2 km west of Ba\'qubah, killing the man in charge of the procession together with his son and wounding three others.\n\nBa\'qubah, the capital of Diyala Province, is 57 km to the northeast of Baghdad.', 2, 'Ba‘qūbah town', 'Ba‘qūbah town (Ghat\'un District, 2 km to the west of)', 'Diyālá province', 'Qaḑā’ Ba‘qūbah', '33.746595', '44.643663', 'POINT(44.643663 33.746595)', 178290, 'Iraq', 'Middle East', 1, 1, '2010-12-12', '2010-12-12', 0, 1, 0, 0, 1, 1, 1, '0101000020E61000009752978C63524640B62DCA6C90DF4040'),
